window.bookSummaryJSON = "<p>Five Aston has known Rory Shrike for as long as he can remember. He played with her in the sandbox. He went to every damn horse show just to be supportive. He helped her with her French, walked her home from school, and faked his test scores just to stay with her a little longer and not be sent off to college early. </p> <p>But eventually he had to move on. </p> <p>And so did she. </p> <p>Never has a second chance meant so much to a boy who loves a girl. </p> <p><i>Five </i>is a standalone book that is a prequel to the Mister series and also a spin-off of the Rook &amp; Ronin series. You can listen to it first, you can listen to it last. It doesn't really matter because it's f--king <i>Five</i>. </p> <p>Includes a special bonus note read by the author. </p>"; 
